import React from 'react'
import { useState } from "react"

const Gallery = () => {
    const [thumbnails, setThumbnails] = useState([])

    return (
    <div>
        <h1 className="text-headBlue font-merriweather text-4xl text-center mt-10">Gallery</h1>
        <h3 className="text-darkOrange font-merriweather text-xl text-center mt-1">Browse our latest albums</h3>
        <section className="grid md:grid-cols-3 grid-cols-2 gap-2">

        </section>
    </div>
  )
}

export default Gallery
